import './Team.css'
import Card from '../Card'

const Time = (props) =>{
    return(
        <section className='team' style={{ backgroundColor: props.secondColor, }}>
            <h3 style={{ borderColor: props.firstColor}}>{props.name}</h3>
            <div></div>
            {props.games.map( game => <Card name={game.name} description={game.description} img={game.img}/>)}
        </section>
    )
}

export default Time
